import './style.scss';

import { Container } from '../Layout';

import hexalabIconGrey from '../../assets/images/hexalab-icon-grey.svg';

export function Footer(props)
{
    return(
        <footer id='rodape'>
            <div id='topo'>
                <Container>
                    <div>
                        <img src={hexalabIconGrey} />

                        <address>
                            <p>© 2020 hexaLAB</p>
                            <p>HEXALAB SOLUCOES EM SOFTWARE LTDA</p>
                            <p>CNPJ 37.267.428/0001-05</p>
                            <p>Rua Teófilo David Muzel, 639, Vila Ophelia, Itapeva/SP, Brasil.</p>
                        </address>
                    </div>
                </Container>
            </div>
        </footer>
    )
}
